    "body": "Per Gessle\nThe Fender Telecaster, colloquially known as the Tele /?t?li/, is the world's first commercially successful solid-body electric guitar. Its simple yet effective design and revolutionary sound broke ground and set trends in electric guitar manufacturing and popular music. Introduced for national distribution as the Broadcaster in the autumn of 1950, it was the first guitar of its kind manufactured on a substantial scale and has been in continuous production in one form or another since its first incarnation.\nGarth Brooks\nThis photo was taken during his tour with Trisha Yearwood. He is seen playing this Fender Telecaster, which is very weird in its appearance. It has 2 P90 pickups and a bridge which is rather unusal for Telecasters. This might also be the Warmoth Partscaster, considering I found pretty close models to this one being a Warmoth, but on this one it says Fender, so I'm just going to go with Fender...\nBrian James\n\"As for the Telecaster, well, a Gibson always sounds like a Gibson, and a Strat, however you set it up, you eventually start playing Hendrix stuff, but, for me, a Telecaster is an anonymous guitar, which relies on what amp you use. Ive managed to get a sound which is fairly unique to me, I think. My main Telecaster has a Fender body and a Squier neck, cause I smashed the neck on tour with The Lords, and my guitar roadie could only find a Squier neck. I found that I had an extra three frets or so to play with, its thinner, so its been on there ever since.\"",
